import React,{use} from 'react';
import { Route, Redirect } from 'react-router-dom';

const ProtectedRoute = ({ component: Component, user, ...props }) => {
  return (
    <Route
      {...props}
      render={(routeProps) =>
        !!user ? <Component {...routeProps} /> : <Redirect to={'/login'} />
      }
    />
  );
};

export default ProtectedRoute;
